import React from "react";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  BarChart,
} from "recharts";
function LineChartt({ data }) {
  return (
    <div className="chart-container">
      {console.log(data)}
      <h2 style={{ textAlign: "center" }}>Line Chart</h2>
      <BarChart width={500} height={300} data={data}>
        <XAxis dataKey="date" />
        <YAxis dataKey="status" />
        <CartesianGrid stroke="#eee" strokeDasharray="5 5" />
        {/* <Line type="monotone" dataKey="date" stroke="#8884d8" /> */}
        <Line type="monotone" dataKey="data" stroke="#82ca9d" />
      </BarChart>
    </div>
  );
}
export default LineChartt;
